  @override
  void initState() {
    super.initState();
    changePDF(3);
  }

  loadDocument() async {
    String dir = (await getApplicationDocumentsDirectory()).path;
    final filename = "default.pdf";
    File file = new File('$dir/$filename');
    document = await PDFDocument.fromFile(file);

    setState(() => _isLoading = false);
  }

// PDF
  changePDF(value) async {
    setState(() => _isLoading = true);
    if (value == 0) {
      document = await PDFDocument.fromURL(
          "http://www.africau.edu/images/default/sample.pdf");
    } else if (value == 1) {
      //document = await PDFDocument.fromAsset('assets/sample2.pdf');
      writePDF(pdfFileExample);
      await loadDocument();
    } else {
      //File file  = File('...');
      //document = await PDFDocument.fromFile(file);
      document = await PDFDocument.fromFile(await writePDF(pdfFileExample));
    }
    setState(() => _isLoading = false);
  }

// Botón clicado
  void onTabTapped(int index) {
    setState(() {
      _currentIndex = index;
      changePDF(index);
    });
  }

// Escribe archivo PDF de String codificado (Base64)
  Future<File> writePDF(String pdfFile) async {
    String dir = (await getApplicationDocumentsDirectory()).path;
    final filename = "pdfEjemplo.pdf";
    final decodedBytes = base64Decode(pdfFile);
    File file = new File('$dir/$filename');
    await file.writeAsBytes(decodedBytes.buffer.asUint8List());
    debugPrint(file.path);
    return file;
  }
}
